If you need to add canister methods to your HTTP server, the Server function imported from azle allows you to do so. Here's an example of a very simple HTTP server: import { Server } from 'azle/experimental';
import express from 'express'; export default Server(() => { const app = express(); app.get('/http-query', (_req, res) => { res.send('http-query-server'); }); app.post('/http-update', (_req, res) => { res.send('http-update-server'); }); return app.listen();
}); You can add canister methods like this: import { query, Server, text, update } from 'azle/experimental';
import express from 'express'; export default Server( () => { const app = express(); app.get('/http-query', (_req, res) => { res.send('http-query-server'); }); app.post('/http-update', (_req, res) => { res.send('http-update-server'); }); return app.listen(); }, { candidQuery: query([], text, () => { return 'candidQueryServer'; }), candidUpdate: update([], text, () => { return 'candidUpdateServer'; }) }
); The default export of your main module must be the result of calling Server, and the callback argument to Server must return a Node.js http.Server . The main module is specified by the main property of your project's dfx.json file . The dfx.json file must be at the root directory of your project. The callback argument to Server can be asynchronous: import { Server } from 'azle/experimental';
import { createServer } from 'http'; export default Server(async () => { const message = await asynchronousHelloWorld(); return createServer((req, res) => { res.write(message); res.end(); });
}); async function asynchronousHelloWorld() { // do some asynchronous task return 'Hello World Asynchronous!';
}

