Azle canisters can import caller from azle and use it to get the principal (public-key linked identifier) of the initiator of an HTTP request. HTTP requests are anonymous (principal 2vxsx-fae) by default, but authentication with web browsers (and maybe Node.js) can be done using a JWT-like API from azle/experimental/http_client. First you import toJwt from azle/experimental/http_client: import { toJwt } from 'azle/experimental/http_client'; Then you use fetch and construct an Authorization header using an @dfinity/agent Identity: const response = await fetch( `http://bkyz2-fmaaa-aaaaa-qaaaq-cai.raw.localhost:8000/whoami`, { method: 'GET', headers: [['Authorization', toJwt(this.identity)]] }
); Here's an example of the frontend of a simple web application using azle/experimental/http_client and Internet Identity : import { Identity } from '@dfinity/agent';
import { AuthClient } from '@dfinity/auth-client';
import { toJwt } from 'azle/experimental/http_client';
import { html, LitElement } from 'lit';
import { customElement, property } from 'lit/decorators.js'; @customElement('azle-app')
export class AzleApp extends LitElement { @property() identity: Identity | null = null; @property() whoami: string = ''; connectedCallback() { super.connectedCallback(); this.authenticate(); } async authenticate() { const authClient = await AuthClient.create(); const isAuthenticated = await authClient.isAuthenticated(); if (isAuthenticated === true) { this.handleIsAuthenticated(authClient); } else { await this.handleIsNotAuthenticated(authClient); } } handleIsAuthenticated(authClient: AuthClient) { this.identity = authClient.getIdentity(); } async handleIsNotAuthenticated(authClient: AuthClient) { await new Promise((resolve, reject) => { authClient.login({ identityProvider: import.meta.env.VITE_IDENTITY_PROVIDER, onSuccess: resolve as () => void, onError: reject, windowOpenerFeatures: `width=500,height=500` }); }); this.identity = authClient.getIdentity(); } async whoamiUnauthenticated() { const response = await fetch( `${import.meta.env.VITE_CANISTER_ORIGIN}/whoami` ); const responseText = await response.text(); this.whoami = responseText; } async whoamiAuthenticated() { const response = await fetch( `${import.meta.env.VITE_CANISTER_ORIGIN}/whoami`, { method: 'GET', headers: [['Authorization', toJwt(this.identity)]] } ); const responseText = await response.text(); this.whoami = responseText; } render() { return html` <h1>Internet Identity</h1> <h2> Whoami principal: <span id="whoamiPrincipal">${this.whoami}</span> </h2> <button id="whoamiUnauthenticated" @click=${this.whoamiUnauthenticated} > Whoami Unauthenticated </button> <button id="whoamiAuthenticated" @click=${this.whoamiAuthenticated} .disabled=${this.identity === null} > Whoami Authenticated </button> `; }
} Here's an example of the backend of that same simple web application: import { caller } from 'azle';
import express from 'express'; const app = express(); app.get('/whoami', (req, res) => { res.send(caller().toString());
}); app.use(express.static('/dist')); app.listen();

